import { Component } from "react";
import MainLayout from "../Layouts/MainLayout";

class Index extends Component {
  render() {
    return (
      <MainLayout>
        <h1>heloo</h1>
      </MainLayout>
    );
  }
}

const mapStateToProps = (state) => {
  console.log(state);
  return {
    settings: state.settings,
  };
};

export default connect(mapStateToProps)(Index);
